  return promise
    .then((result) => {
      console.log("Got a response from the API");
      return {
        status: 200,
        body: 'success'
      };
    })
    .catch((error) => {
      console.error(error);
      return new Error(); // Return an empty Error object for rejection
    });
}

export default handleResponseFromAPI;

